import React from 'react';
import {IAirport} from "../models/models";

interface AirportCardProps {
    airport: IAirport
}

export default function AirportCard({airport}: AirportCardProps){
    return (
        <div className="border rounded-md px-6 py-4 mb-2 hover:shadow-md hover:transition-all cursor-pointer">
            <p className="text-lg font-bold">{airport.name}</p>
            <p>{airport.region}</p>
        </div>
    );
};
